import React from "react";

function Header() {
  return (
    <div>
      <h2
        style={{
          backgroundImage:
            "https://jointheallyance.de/wp-content/uploads/2021/03/capsule_616x353.jpg",
          backgroundPosition: "100%",
          backgroundSize: "cover",
